-- insert into dbo.trtBaseReference only the missing values.
--

INSERT INTO dbo.trtBaseReference
(
    idfsBaseReference,
    idfsReferenceType,
    strBaseReferenceCode,
    strDefault,
    intHACode,
    intOrder,
    blnSystem,
    intRowStatus,
    rowguid,
    strMaintenanceFlag,
    strReservedAttribute,
    SourceSystemNameID,
    SourceSystemKeyValue,
    AuditCreateUser,
    AuditCreateDTM,
    AuditUpdateUser,
    AuditUpdateDTM,
    change_type
)
SELECT 
	idfsBaseReference,
    idfsReferenceType,
    strBaseReferenceCode,
    strDefault,
    intHACode,
    intOrder,
    blnSystem,
    intRowStatus,
    rowguid,
    strMaintenanceFlag,
    strReservedAttribute,
    SourceSystemNameID,
    SourceSystemKeyValue,
    AuditCreateUser,
    AuditCreateDTM,
    AuditUpdateUser,
    AuditUpdateDTM,
    CASE SourceSystemNameID WHEN 10519002 THEN 'UPDATE' ELSE 'ADD' END
	
FROM @trtB WHERE idfsBaseReference NOT IN (SELECT idfsBaseReference FROM dbo.trtBaseReference)


--
-- one final update to ensure pre-existing data is also updated
--

UPDATE T
SET T.idfsReferenceType = S.idfsReferenceType,
	T.strBaseReferenceCode = S.strBaseReferenceCode,
	T.strDefault = S.strDefault,
	T.intHACode = S.intHACode,
	T.intOrder = S.intOrder,
	T.blnSystem = S.blnSystem,
	T.intRowStatus = S.intRowStatus,
	T.AuditUpdateUser = 'System',
	T.AuditUpdateDTM = GETDATE()

FROM dbo.trtBaseReference T
INNER JOIN @trtB S ON S.idfsBaseReference = T.idfsBaseReference

